import React from "react";
import './'

const Instructions = () => {
  return (
    <div className="instructions-container">
      <div className="instructions-card">
        <h2>Quiz Instructions</h2>
        <ul>
          <li>You have limited time to complete the quiz.</li>
          <li>Each question has four options, with only one correct answer.</li>
          <li>Click "Next" to move to the next question.</li>
          <li>There is no negative marking.</li>
          <li>Your final score will be displayed at the end.</li>
        </ul>
        <button className="start-btn">Start Quiz</button>
      </div>
    </div>
  );
};

export default Instructions;
